/*--------------------------------------------------
	[1. Promo Blocks]
----------------------------------------------------*/
/*Promo Background Images*/
.promo-bg-pattern-v1-dark {
  background: url(../img/patterns/5.png) repeat;
}

.promo-bg-pattern-v1-light {
  background: url(../img/patterns/16.png) repeat;
}

/*Promo Background Images*/
.promo-bg-img-v1 {
  background: url(../img/bg/img1.jpg) no-repeat;
  background-size: cover;
}
.promo-bg-img-v2 {
  background: url(../img/bg/img5.jpg) no-repeat;
  background-size: cover;
}
.promo-bg-img-v3 {
  background: url(../img/bg/img10.jpg) no-repeat;
  background-size: cover;
}
.promo-bg-img-v4 {
  background: url(../img/bg/img11.jpg) no-repeat;
  background-size: cover;
}
.promo-bg-img-v5 {
  background: url(../img/stock/Prism-workgroup.jpg) no-repeat;
  background-size: cover;
}

/*Promo Background Fixed*/
.promo-bg-fixed {
  background-attachment: fixed;
}

/*Promo Texts v1*/
.promo-text-v1 {
  padding: 3px 0;
  font-size: 20px;
  font-weight: 600;
  display: inline-block;
  border-bottom: solid 2px #fff;
}

.promo-text-v1.color-dark {
  border-color: #555;
}

/*Promo Texts v2*/
.promo-text-v2 {
  font-size: 55px;
  font-weight: 600;
  line-height: 63px;
}

/*Promo Video Icon*/
.promo-video-icon-wrap {
  width: 64px;
  height: 64px;
  font-size: 18px;
  line-height: 70px;
  display: inline-block;
  transition: all .3s ease-in-out;
}

.promo-video-icon-wrap:hover {
  color: #333;
  text-decoration: none;
}

.promo-video-icon-wrap.color-light {
  color: #333;
  background: rgba(255,255,255,1);
}
.promo-video-icon-wrap.color-light:hover {
  background: rgba(255,255,255,.9);
}

.promo-video-icon-wrap.color-dark {
  color: #fff;
  background: rgba(0,0,0,.8);
}
.promo-video-icon-wrap.color-dark:hover {
  color: #fff;
  background: rgba(0,0,0,.9);
}

.promo-video-icon {
  left: 3px;
  position: relative;
}

/*--------------------------------------------------
	[2. Breadcrumbs]
----------------------------------------------------*/
/*Default Breadcrumbs*/
.breadcrumbs {
  overflow: hidden;
  padding: 10px 0 6px;
  border-bottom: solid 1px #eee;
  background: url(../img/patterns/breadcrumbs.png) repeat;
}

.video-business-img1 {
   /*background: url(../img/img1.jpg) no-repeat center;*/

   /*background: url(../video/shutterstock.mp4) no-repeat center;*/
   background-size: cover; /*Scales thes background image to be as large as possible*/
 }

.video {
    /*min-height: 100%;*/
    /*min-width: 100%;*/
    height: 100%;
    width: 100%;
    z-index: 1;
    position: absolute;
}

.video-business-img2 {

  background-size: cover; /*Scales the background image to be as large as possible*/
}
.breadcrumbs h1 {
  color: #666;
  font-size: 22px;
  margin-top: 8px;
}

.breadcrumb {
  top: 10px;
  z-index: 1;
  padding-right: 0;
  background: none;
  position: relative;
}
.breadcrumb a {
  color: #777;
}
.breadcrumb li.active,
.breadcrumb li a:hover {
  color: #72c02c;
  text-decoration: none;
}

@media (max-width: 550px) {
  .breadcrumbs h1.pull-left,
  .breadcrumbs ul.pull-right {
    width: 100%;
    text-align: center;
  }

  .breadcrumbs h1.pull-left {
    margin-bottom: 0;
  }

  .breadcrumbs .breadcrumb {
    top: 0;
    margin-bottom: 10px;
  }
}

/*Breadcrumbs Dark and Light*/
.breadcrumbs.breadcrumbs-dark,
.breadcrumbs.breadcrumbs-light {
  background: #222;
  padding: 30px 0 20px;
  border-bottom: solid 3px #777;
}

.breadcrumbs.breadcrumbs-light {
  background: #f7f7f7;
  border-bottom: 1px solid #eee;
}

.breadcrumbs.breadcrumbs-dark h1,
.breadcrumbs.breadcrumbs-dark a,
.breadcrumbs.breadcrumbs-light h1,
.breadcrumbs.breadcrumbs-light a {
  color: #fff;
  font-weight: 200;
}

.breadcrumbs.breadcrumbs-light h1,
.breadcrumbs.breadcrumbs-light a {
  color: #555;
}

.breadcrumbs.breadcrumbs-dark h1 {
  font-size: 24px;
}

.breadcrumbs.breadcrumbs-light h1 {
  font-size: 26px;
}

/*Breadcrumbs Sizes*/

.breadcrumbs-md {
  padding: 100px 0;
}
.breadcrumbs-lg {
  padding: 200px 0;
}

/*Breadcrumbs v1 and v3
------------------------------------*/
.breadcrumbs-v1,
.breadcrumbs-v3 {
	/* transition: all 0.8s ease-in-out; */
}

/*Breadcrumbs v1
------------------------------------*/
.breadcrumbs-v1 {
  padding: 100px 0;
  position: relative;
  background: url(../img/breadcrumbs/img1.jpg) center no-repeat;
  background-size: cover; /*Scales the background image to be as large as possible*/
}

.breadcrumbs-v1:after {
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  content: " ";
  position: absolute;
  background: rgba(0,0,0,0.15);
}

.breadcrumbs-v1 span,
.breadcrumbs-v1 h1 {
  color: #fff;
  z-index: 1;
  position: relative;
}

.breadcrumbs-v1 span {
  font-size: 24px;
  font-weight: 200;
  margin-bottom: 5px;
  display: inline-block;
}

.breadcrumbs-v1 h1 {
  font-size: 50px;
  margin-bottom: 0;
  line-height: 55px;
  text-transform: uppercase;
}

@media (max-width: 768px) {
  .breadcrumbs-v1 {
    padding: 50px 0;
  }

  .breadcrumbs-v1 h1 {
    font-size: 40px;
    line-height: 45px;
  }
}

/*Breadcrumbs v2
------------------------------------*/
.breadcrumbs-v2 {
  text-align: center;
  position: relative;
  background: url(../img/bg/11.jpg) no-repeat center;
}

.breadcrumbs-v2-in {
  padding: 80px 0;
  position: relative;
}

.breadcrumbs-v2 h1 {
  color: #fff;
  text-transform: uppercase;
}

.breadcrumb-v2 li a,
.breadcrumb-v2 li.active {
  color: #fff;
}

.breadcrumb-v2 li i {
  color: #fff;
  min-width: 19px;
  padding: 3px 7px;
  margin-right: 5px;
  text-align: center;
  border: 1px solid #fff;
}

/*Breadcrumbs v3
------------------------------------*/


.breadcrumbs-v3 {
  z-index: 1;
  position: sticky;
  max-height: 100px;
}


.breadcrumbs-v3.breadcrumbs-lg {
  padding: 200px 0;
}

.breadcrumbs-v3.img-v1 {
  background: url(../img/sliders/support2LRG-3sm.jpg) no-repeat;
  background-size: cover;
  background-position: center center;
  max-height: 300px;
}
.breadcrumbs-v3.img-v1-a {
  background: url(../img/sliders/slider-img3-a.jpg) no-repeat;
  background-size: cover;
  background-position: center top;
}
.breadcrumbs-v3.img-dr {
  background: url(../img/breadcrumbs/img-dr-1.png) no-repeat;
  background-size: cover;
  background-position: center top;
}

.breadcrumbs-v3.img-v2 {
  background: url(../img/breadcrumbs/img2.jpg) no-repeat;
  background-size: cover;
  background-position: center center;
}

.breadcrumbs-v3.img-v3 {
  background: url(../img/breadcrumbs/img3.jpg) no-repeat;
  background-size: cover;
  background-position: center center;
}
.breadcrymbs-v3.breadcrumbs-sm {
  max-height: 265px;
}

.breadcrumbs-v3:after {
  top: 0;
  left: 0;
  z-index: -1;
  width: 100%;
  height: 100%;
  content: " ";
  position: absolute;
  background: rgba(0,0,0,0.4);
}

.breadcrumbs-v3 h1 {
  color: #fff;
  font-size: 40px;
  line-height: 50px;
  text-transform: uppercase;
}

.breadcrumbs-v3 p {
  color: #fff;
  font-size: 24px;
  font-weight: 200;
  margin-bottom: 0;
  text-transform: uppercase;
}

@media (max-width: 992px) {
  .breadcrumbs-v3.breadcrumbs-lg {
    padding: 100px 0;
  }
}

@media (max-width: 768px) {
  .breadcrumbs-v3,
  .breadcrumbs-v3.breadcrumbs-lg {
    padding: 50px 0;
  }

  .breadcrumbs-v3 h1 {
    font-size: 30px;
    line-height: 40px;
  }

  .breadcrumbs-v3 p {
    font-size: 18px;
  }
}

/*Breadcrumbs v4
------------------------------------*/
.breadcrumbs-v4 {
  z-index: 1;
  padding: 100px 0;
  position: relative;
}

.breadcrumbs-v4.breadcrumbs-lg {
  padding: 200px 0;
}

.breadcrumbs-v4.img-dr {
  background: url(../img/breadcrumbs/img-dr-1.png) no-repeat;
  background-size: cover;
  background-position: center top;
}



.breadcrumbs-v4:after {
  top: 0;
  left: 0;
  z-index: -1;
  width: 100%;
  height: 100%;
  content: " ";
  position: absolute;
  background: rgba(0,0,0,0.4);
}

.breadcrumbs-v4 h1 {
  color: #fff;
  font-size: 40px;
  line-height: 70px;
  text-transform: uppercase;
}

.breadcrumbs-v4 p {
  color: #fff;
  font-size: 24px;
  font-weight: 200;
  margin-bottom: 0;
  text-transform: uppercase;
}

@media (max-width: 992px) {
  .breadcrumbs-v4.breadcrumbs-lg {
    padding: 100px 0;
  }
}

@media (max-width: 768px) {
  .breadcrumbs-v4,
  .breadcrumbs-v4.breadcrumbs-lg {
    padding: 50px 0;
  }

  .breadcrumbs-v4 h1 {
    font-size: 30px;
    line-height: 40px;
  }

  .breadcrumbs-v4 p {
    font-size: 18px;
  }
}

/*--------------------------------------------------
	[3. Image Hover Effects]
----------------------------------------------------*/
/*Image Hover v1*/
.img-hover-v1 span {
  display: block;
  overflow: hidden;
  position: relative;
}

.img-hover-v1 span:after {
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  content: " ";
  position: absolute;
}

.img-hover-v1:hover span:after {
  background: rgba(0,0,0,0.3);
}

.img-hover-v1 img,
.img-hover-v2 img,
.img-hover-v1 span:after {
  transition: all 0.5s ease-in-out;
}

.img-hover-v1:hover img {
  -transform: scale(1.1);
}

/*Image Hover v2*/
.img-hover-v2 img {
  filter: grayscale(100%);
  -webkit-filter: grayscale(100%);
}

.img-hover-v2:hover img {
  filter: grayscale(0);
  -webkit-filter: grayscale(0);
}

/*--------------------------------------------------
	[4. Block Grid]
----------------------------------------------------*/
/*Block Grid v1
------------------------------------*/
.block-grid-v1 {
  background: #fff;
  padding: 15px 15px 5px;
  border-bottom: solid 2px #eee;
  transition: all 0.4s ease-in-out;
}

.block-grid-v1:hover {
  border-color: #72c02c;
}

.block-grid-v1 img {
  margin-bottom: 10px;
}

.block-grid-v1 img.block-grid-v1-img {
  width: 35px;
  height: 35px;
  margin-top: 8px;
}

.block-grid-v1.content-boxes-v1 img.pull-left {
  float: inherit !important;
}

.block-grid-v1 h3 a {
  font-size: 22px;
  font-weight: 200;
  margin-right: 10px;
}

.block-grid-v1.content-boxes-v1 h3 {
  margin-bottom: 0;
}

.block-grid-v1.content-boxes-v1 h3 a {
  color: #555;
}

/*Star Vote*/
.block-grid-v1 .star-vote {
  padding: 0;
  margin-bottom: 10px;
  vertical-align: middle;
}

.block-grid-v1 .star-vote li {
  padding: 0;
  font-size: 11px;
  display: inline-block;
}

/*Additional Info*/
.block-grid-v1-add-info {
  margin: 0;
  padding-top: 15px;
  border-top: solid 1px #eee;
}

.block-grid-v1-add-info li {
  padding: 0;
  margin-right: 3px;
  margin-bottom: 10px;
}

.block-grid-v1-add-info li a {
  font-size: 11px;
  padding: 4px 7px;
  text-decoration: none;
  border: solid 2px #eee;
  border-radius: 3px !important;
}

/*Block Grid v2
------------------------------------*/
.block-grid-v2 {
  padding: 0;
}

.block-grid-v2 li {
	list-style: none;
	position: relative;
	-webkit-backface-visibility: hidden; /*For Chrome*/
}

.block-grid-v2-info {
  padding: 15px;
  text-align: center;
  background: #f9f9f9;
  border-bottom: solid 3px #eee;
	transition: all 0.4s ease-in-out;
}

.block-grid-v2 li:hover .block-grid-v2-info {
  border-color: #72c02c;
}

.block-grid-v2-info h3 {
  font-size: 22px;
  font-weight: 200;
  margin-bottom: 10px;
}

.block-grid-v2-info .star-vote li {
  padding: 2px;
  font-size: 16px;
}

/*--------------------------------------------------
	[5. Services Box]
----------------------------------------------------*/
/* Services Box v1
------------------------------------*/
.service-box-v1 .service-block {
  background: #fff;
  padding-top: 30px;
  padding-bottom: 20px;
}

.service-box-v1 p {
  position: relative;
  margin-bottom: 50px;
}

.service-box-v1 p:after {
  content: " ";
  left: 50%;
  height: 1px;
  width: 50px;
  bottom: -15px;
  position: absolute;
  margin-left: -25px;
  background: #72c02c;
}

.service-box-v1 ul {
  padding: 0 40px;
}

.service-box-v1 li {
  margin: 8px 0;
  font-size: 15px;
  padding-top: 8px;
  border-top: dotted 1px #72c02c;
}

.service-box-v1 li:hover {
  color: #72c02c;
}

.service-box-v1 li:first-child {
  padding-top: 0;
  border-top: none;
}

/*--------------------------------------------------
	[6. Service Block ]
----------------------------------------------------*/
/*Service Block v1
------------------------------------*/
.service-block-v1 {
  margin-top: 20px;
  text-align: center;
  position: relative;
  padding: 45px 20px 20px;
  /*border: 1px solid #f2f2f2;*/
}

.service-block-v1 i {
  left: 50%;
  top: -30px;
  color: #fff;
  width: 60px;
  height: 60px;
  font-size: 26px;
  line-height: 62px;
  margin-left: -30px;
  text-align: center;
  position: absolute;
  background: #72c02c;
  display: inline-block;
}

.service-block-v1 h3,
.service-block-v1 p {
  margin-bottom: 20px;
}

/*Service Block v2 (used in page_404_error2.html)
------------------------------------*/
.service-block-v2 .service-block-in {
  padding: 20px 30px;
  text-align: center;
  margin-bottom: 15px;
  background: rgba(255,255,255,0.2);
}

.service-block-v2 .service-block-in i {
  font-size: 40px;
}

.service-block-v2 .service-block-in h4 {
  line-height: 25px;
}

.service-block-v2 .service-block-in p {
  margin-bottom: 20px;
}

.service-block-v2 .service-block-in i,
.service-block-v2 .service-block-in h4,
.service-block-v2 .service-block-in p {
  color: #fff;
}

/*Service Block v3 (used in profile pages)
------------------------------------*/
.service-block-v3 {
  padding: 20px;
}

.service-block-v3 i {
  color: #fff;
  float: left;
  font-size: 50px;
  margin: 0 20px 20px 0;
}

.service-block-v3 .service-heading,
.service-block-v3 .service-in small {
  color: #fff;
  opacity: 0.8;
  line-height: 1;
}

.service-block-v3 .service-in h4,
.service-block-v3 .counter {
  color: #fff;
}

.service-block-v3 .service-heading {
  font-size: 16px;
  text-transform: uppercase;
}

.service-block-v3 .counter {
  display: block;
  line-height: 1;
  font-size: 30px;
}

.service-block-v3 .progress {
  margin-bottom: 7px;
}

/*Service Innner*/
.service-block-v3 .service-in small {
  font-size: 16px;
  text-transform: uppercase;
}

.service-block-v3 .service-in h4 {
  font-size: 16px;
  line-height: 0.8;
  margin-bottom: 0;
}

/*Statistics*/
.service-block-v3 .statistics .heading-xs {
  color: #fff;
  opacity: 0.8;
}

.service-block-v3 .statistics small {
  color: #fff;
}

.service-block-v3 .statistics .progress {
  background: #bbb;
}

.service-block-v3 .statistics .progress-bar-light {
  background: #fff;
}

/*Service Block v4
------------------------------------*/
.service-block-v4 {
  position: relative;
  background: #f7f7f7;
}

.service-block-v4:after {
  top: 0;
  width: 0;
  height: 0;
  left: 50%;
  content: '';
  margin-left: -20px;
  position: absolute;
  border-style: solid;
  border-width: 25px 20px 0 20px;
  border-color: #fff transparent transparent transparent;
}

.service-block-v4 .service-desc {
  text-align: center;
}

.service-block-v4 .service-desc i {
  color: #72c02c;
  display: block;
  font-size: 30px;
  margin-bottom: 20px;
}

.service-block-v4 .service-desc h3 {
  font-size: 18px;
  margin-bottom: 15px;
  text-transform: uppercase;
}
/*Service Block v4-wht
------------------------------------*/
.service-block-v4w {
  position: relative;
  background: #fff;
}

.service-block-v4w:after {
  top: 0;
  width: 0;
  height: 0;
  left: 50%;
  content: '';
  margin-left: -20px;
  position: absolute;
  border-style: solid;
  border-width: 25px 20px 0 20px;
  border-color: #fff transparent transparent transparent;
}

.service-block-v4w .service-desc {
  text-align: center;
}

.service-block-v4w .service-desc i {
